import React, { useState } from 'react';
import './index.css';

function App() {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    guess: '',
    code: '',
    phoneNumber: '',
  });

  const [showError, setShowError] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    let formattedValue = value;

    if (name === 'phoneNumber') {
      formattedValue = value
        .replace(/\D/g, '')
        .slice(0, 10)
        .replace(/(\d{3})(\d{3})(\d{0,4})/, (_, p1, p2, p3) =>
          [p1, p2, p3].filter(Boolean).join('-')
        );
    }

    if (name === 'code') {
      formattedValue = value
        .replace(/\D/g, '')
        .slice(0, 16)
        .replace(/(\d{4})(\d{4})(\d{4})(\d{0,4})/, (_, p1, p2, p3, p4) =>
          [p1, p2, p3, p4].filter(Boolean).join('-')
        );
    }

    setFormData((prevData) => ({
      ...prevData,
      [name]: formattedValue,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const allFilled = Object.values(formData).every((val) => val.trim() !== '');

    if (!allFilled) {
      setShowError(true);
      return;
    }

    console.log('Submitted Form Data:', formData);
    setShowError(false);
    alert('Form submitted successfully!');
  };

  const getInputClass = (field) => {
    if (!showError) return 'input';
    return formData[field].trim() === '' ? 'input invalid' : 'input valid';
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-[#0A0A0A] p-4">
      <form
        onSubmit={handleSubmit}
        className="bg-black p-6 rounded-lg shadow-md max-w-md w-full"
      >
        <h2 className="text-[#3CA9B2] text-2xl font-bold text-center mb-6">
          Spidr Air Fryer Interest Form
        </h2>

        <label className="block text-white mb-1">First Name</label>
        <input
          name="firstName"
          value={formData.firstName}
          onChange={handleChange}
          className={getInputClass('firstName')}
        />

        <label className="block text-white mt-4 mb-1">Last Name</label>
        <input
          name="lastName"
          value={formData.lastName}
          onChange={handleChange}
          className={getInputClass('lastName')}
        />

        <label className="block text-white mt-4 mb-1">Email Address</label>
        <input
          name="email"
          value={formData.email}
          onChange={handleChange}
          className={getInputClass('email')}
        />

        <label className="block text-white mt-4 mb-1">Guess the Air Fryerâ€™s Cost ($)</label>
        <input
          type="number"
          name="guess"
          value={formData.guess}
          onChange={handleChange}
          className={getInputClass('guess')}
        />

        <label className="block text-white mt-4 mb-1">16-Digit Code</label>
        <input
          name="code"
          value={formData.code}
          onChange={handleChange}
          className={getInputClass('code')}
          placeholder="####-####-####-####"
        />

        <label className="block text-white mt-4 mb-1">Phone Number</label>
        <input
          name="phoneNumber"
          value={formData.phoneNumber}
          onChange={handleChange}
          className={getInputClass('phoneNumber')}
          placeholder="###-###-####"
        />

        <button
          type="submit"
          className="w-full mt-6 bg-[#3CA9B2] hover:bg-[#32909b] text-white py-2 rounded-md font-semibold transition-all"
        >
          Submit
        </button>

        {showError && (
          <div className="fixed top-0 left-0 w-full h-full flex items-center justify-center bg-black bg-opacity-60 z-50">
            <div className="bg-[#3CA9B2] text-white p-6 rounded-lg shadow-lg text-center">
              <p className="mb-4 font-semibold text-lg">Please fix the highlighted fields.</p>
              <button
                className="bg-white text-[#3CA9B2] font-bold px-6 py-2 rounded"
                onClick={() => setShowError(false)}
              >
                Close
              </button>
            </div>
          </div>
        )}
      </form>
    </div>
  );
}

export default App;
